import React from "react";
import { Form } from "react-bootstrap";
import "./Filter.css";

const Filter = ({ handleChange }) => {
  return (
    <form>
      <label className="container" for="diet">
        {" "}
        Standard
        <input
          type="checkbox"
          id="diet1"
          name="diet"
          value="Standard"
          onChange={handleChange}
        ></input>
      </label>
      <label className="container" for="diet">
        {" "}
        Vegetarian
        <input
          type="checkbox"
          id="diet2"
          name="diet"
          value="Vegetarian"
          onChange={handleChange}
        ></input>
      </label>
      <label className="container" for="diet">
        {" "}
        Vegan
        <input
          type="checkbox"
          id="diet1"
          name="diet"
          value="Vegan"
          onChange={handleChange}
        ></input>
      </label>
    </form>
  );
};

export default Filter;
